import React, { Component } from 'react';
import './App.css';
import {Route, Switch, Link} from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <div className="App">
      <Link to='/'>Home</Link>
      <Link to='/shops'>Shops</Link>
       <Switch>
         <Route path='/' exact component={Home}/>
         <Route path='/shops' component={Shops}/>
       </Switch>
      </div>
    );
  }
}

const Home = ()=> <h1>Home</h1>

const Shops =(props)=> {
  return(
           <div>
           <h1>Shops</h1>
           <Link to={props.match.url + '/hats'}>Hats</Link>
           <Link to={props.match.url + '/shoes'}>Shoes</Link>
           <Switch>
             <Route path={props.match.path + '/hats'} render={()=> <Shop subject='Hats' />}/>
             <Route path={props.match.path + '/shoes'} render={()=> <Shop subject='Shoes' />}/>
           </Switch>
           </div>
  )
}
const Shop = (props)=> 
<h1>{props.subject}</h1>

export default App;
